import './Navbar.css';
import React, { Component } from "react";
import {Link} from "react-router-dom";

class Navbar extends React.Component {
    render() {
        return (
        <div className="Navbar">
            <Link to="/">Home</Link>
            <Link to="/">All Modules</Link>
            <Link to="/">Builder</Link>
        </div>)
    }
}

export default Navbar;
